import React, { useState, useEffect } from 'react';
import axios from 'axios';

const NuevoPedidoForm = ({ onPedidoAgregado }) => {
    const [nuevoPedido, setNuevoPedido] = useState({
        fecha_creacion: '',
        fecha_pedido: '',
        total_pedido: 0,
        estado_pedido: 'por hacer',
        productos: {
            tipo_producto: {
                nombre_tipo_producto: '',
                estado_tipo_producto: '',
            },
            nombre_producto: '',
            estado_producto: '',
            cantidad_producto: 0,
            precio_producto: 0,
            estado_producto_catalogo: '',
            subtotal: 0,
        },
        servicios: {
            tipo_servicio: {
                nombre_tipo_servicio: '',
                estado_tipo_servicio: '',
            },
            nombre_servicio: '',
            estado_servicio: '',
            cantidad_servicio: 0,
            precio_servicio: 0,
            estado_servicio_catalogo: '',
            subtotal: 0,
        },
    });

    useEffect(() => {
        const fechaCreacionActual = new Date().toISOString().split('T')[0];
        setNuevoPedido((prevPedido) => ({
            ...prevPedido,
            fecha_creacion: fechaCreacionActual,
            fecha_pedido: new Date(new Date(fechaCreacionActual).getTime() + 5 * 24 * 60 * 60 * 1000)
                .toISOString()
                .split('T')[0],
        }));
    }, []);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNuevoPedido((prevPedido) => ({
            ...prevPedido,
            [name]: value,
        }));
    };

    const handleProductoChange = (e) => {
        const { name, value } = e.target;
        setNuevoPedido((prevPedido) => ({
            ...prevPedido,
            productos: {
                ...prevPedido.productos,
                tipo_producto: {
                    ...prevPedido.productos.tipo_producto,
                    [name]: value,
                },
            },
        }));
    };

    const handleServicioChange = (e) => {
        const { name, value } = e.target;
        setNuevoPedido((prevPedido) => ({
            ...prevPedido,
            servicios: {
                ...prevPedido.servicios,
                tipo_servicio: {
                    ...prevPedido.servicios.tipo_servicio,
                    [name]: value,
                },
            },
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:3000/pedidos', nuevoPedido);
            onPedidoAgregado(response.data);
            setNuevoPedido({
                fecha_creacion: '',
                fecha_pedido: '',
                total_pedido: 0,
                estado_pedido: 'por hacer',
                productos: {
                    tipo_producto: {
                        nombre_tipo_producto: '',
                        estado_tipo_producto: '',
                    },
                    nombre_producto: '',
                    estado_producto: '',
                    cantidad_producto: 0,
                    precio_producto: 0,
                    estado_producto_catalogo: '',
                    subtotal: 0,
                },
                servicios: {
                    tipo_servicio: {
                        nombre_tipo_servicio: '',
                        estado_tipo_servicio: '',
                    },
                    nombre_servicio: '',
                    estado_servicio: '',
                    cantidad_servicio: 0,
                    precio_servicio: 0,
                    estado_servicio_catalogo: '',
                    subtotal: 0,
                },
            });
        } catch (error) {
            console.error('Error al agregar un nuevo pedido:', error);
        }
    };

    return (
        <form
            style={{
                display: 'flex',
                alignItems: 'center',
                minHeight: '100%',
                flexDirection: 'column',
                justifyContent: 'center',
            }}
            onSubmit={handleSubmit}
        >
            <label>Fecha de Creación:</label>
            <input
                type="date"
                name="fecha_creacion"
                value={nuevoPedido.fecha_creacion}
                onChange={handleInputChange}
                readOnly
            />

            <label>Fecha de Pedido:</label>
            <input
                type="date"
                name="fecha_pedido"
                value={nuevoPedido.fecha_pedido}
                onChange={handleInputChange}
                min={nuevoPedido.fecha_creacion}
            />

            <label>Total Pedido:</label>
            <input
                type="number"
                name="total_pedido"
                value={nuevoPedido.total_pedido}
                onChange={handleInputChange}
            />

            <h2>Productos</h2>
            <label>Tipo Producto:</label>
            <input
                type="text"
                name="nombre_tipo_producto"
                value={nuevoPedido.productos.tipo_producto.nombre_tipo_producto}
                onChange={handleProductoChange}
            />

            <label>Nombre Producto:</label>
            <input
                type="text"
                name="nombre_producto"
                value={nuevoPedido.productos.nombre_producto}
                onChange={handleProductoChange}
            />

            {/* ... (resto de campos de productos) */}

            <h2>Servicios</h2>
            <label>Tipo Servicio:</label>
            <input
                type="text"
                name="nombre_tipo_servicio"
                value={nuevoPedido.servicios.tipo_servicio.nombre_tipo_servicio}
                onChange={handleServicioChange}
            />

            <label>Nombre Servicio:</label>
            <input
                type="text"
                name="nombre_servicio"
                value={nuevoPedido.servicios.nombre_servicio}
                onChange={handleServicioChange}
            />

            {/* ... (resto de campos de servicios) */}

            <br />
            <button type="submit">Agregar Pedido</button>
        </form>
    );
};

export default NuevoPedidoForm;
